import React from "react";
import styled from 'styled-components';

export const BoardHeader: React.FC = () => {
  return (
    <StyledBoardHeader>
      <StyledBoardItem>
        Board Name
      </StyledBoardItem>
      <StyledBoardItem>
        Workspace Name
      </StyledBoardItem>
    </StyledBoardHeader>
  );
}

const StyledBoardHeader = styled.div`
  height: 35px;
  background-color: #d2d2d2;
  display: flex;
  align-items: center;
`;

const StyledBoardItem = styled.div`
  background-color: rgb(155, 155, 155);
  padding: 8px 15px;
  border-radius: 7px;
  margin: 0 10px;
  cursor: pointer;
`;
